import React from 'react';

class aboutComponent extends React.Component {

    render() {
        return (
            <div>
                <h1>About This App</h1>
                <p>This app allows you to scan handwritten or printed text in order to use the text digitally.
                    \nSimply click the "Scan Text" button in the menu in order to take pictures of the text you would like to scan. As text is scanned it will be added to the "View Text" page, use the "View Text" menu button to view, edit or copy your text."</p>
            </div>
        );
    }
}

export default aboutComponent
